
DROP TABLE IF EXISTS `umgdb`.`clients` ;

CREATE SCHEMA IF NOT EXISTS `umgdb` DEFAULT CHARACTER SET utf8 ;
USE `umgdb` ;

-- -----------------------------------------------------
-- Table `umgdb`.`clients`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS `umgdb`.`clients` (
  `ID` INT NOT NULL AUTO_INCREMENT PRIMARY KEY,
  `CLIENT` INT NOT NULL,
  `DATAS` VARCHAR(45) NULL,
  `BUKRS` VARCHAR(45) NOT NULL,
  `COPA_ID` VARCHAR(45) NULL,
  `UNIT` TINYINT(1) NULL,
  `COPA_VALUE` VARCHAR(45) NULL,
  `TENT_DEF` TINYINT(1) NULL,
  `ACTIVE` TINYINT(1) NULL,
  `CREATE_TIME` DATETIME NOT NULL,
  `UPDATED_TIME` DATETIME NOT NULL)
ENGINE = InnoDB;

;
    
